import React from 'react';
import { Briefcase, Calendar, MapPin } from 'lucide-react';
import { motion } from 'framer-motion';

const Experience: React.FC = () => {
  const experiences = [
    {
      title: "Software Engineering Intern",
      company: "Google",
      location: "Mountain View, CA",
      period: "June 2024 - August 2024",
      description: [
        "Developing and optimizing internal tools for Google's Cloud Platform team",
        "Implementing new features and fixing bugs in existing services",
        "Collaborating with cross-functional teams to deliver high-quality solutions"
      ],
      technologies: ["Python", "Go", "Kubernetes", "Docker"]
    },
    {
      title: "Research Assistant",
      company: "Harvard Computer Science Department",
      location: "Cambridge, MA",
      period: "January 2024 - Present",
      description: [
        "Working on machine learning models for natural language processing",
        "Contributing to research papers and technical documentation",
        "Implementing and testing new algorithms for text analysis"
      ],
      technologies: ["Python", "PyTorch", "NLP", "Git"]
    },
    {
      title: "Software Development Intern",
      company: "Microsoft",
      location: "Redmond, WA",
      period: "June 2023 - August 2023",
      description: [
        "Developed features for Microsoft Teams using React and TypeScript",
        "Improved application performance by optimizing database queries",
        "Participated in code reviews and agile development processes"
      ],
      technologies: ["React", "TypeScript", "Azure", "SQL"]
    }
  ];

  return (
    <section id="experience" className="py-16">
      <div className="max-w-6xl mx-auto px-4 sm:px-8 lg:px-12">
        <div className="flex items-center gap-4 mb-8">
          <h2 className="text-4xl font-bold bg-gradient-to-r from-purple-400 via-pink-400 to-blue-400 bg-clip-text text-transparent">
            Experience
          </h2>
          <div className="h-[1px] flex-1 bg-gradient-to-r from-purple-400/50 via-pink-400/50 to-blue-400/50"></div>
        </div>

        <div>
          {experiences.map((exp, index) => (
            <motion.div 
              key={index}
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true, margin: "-100px" }}
              transition={{ duration: 0.5, delay: 0.1  }}
              className="group rounded-[8px] p-5 hover:bg-white/5 hover:backdrop-blur-sm transition-all duration-300 shadow-[0_4px_6px_-1px_rgba(0,0,0,0)] hover:shadow-[0_10px_15px_-3px_rgba(0,0,0,0.2)]"
            >
              <div className="flex flex-col space-y-3">
                <div className="flex items-start justify-between">
                  <div>
                    <h3 className="text-2xl font-semibold text-white group-hover:bg-gradient-to-r group-hover:from-purple-400 group-hover:via-pink-400 group-hover:to-blue-400 group-hover:bg-clip-text group-hover:text-transparent transition-all duration-300">{exp.title}</h3>
                    <div className="flex items-center space-x-4 mt-1.5">
                      <div className="flex items-center text-white/70">
                        <Briefcase size={16} className="mr-2" />
                        <span>{exp.company}</span>
                      </div>
                      <div className="flex items-center text-white/70">
                        <MapPin size={16} className="mr-2" />
                        <span>{exp.location}</span>
                      </div>
                      <div className="flex items-center text-white/70">
                        <Calendar size={16} className="mr-2" />
                        <span>{exp.period}</span>
                      </div>
                    </div>
                  </div>
                </div>

                <ul className="list-disc list-inside space-y-1.5 text-white/70">
                  {exp.description.map((item, i) => (
                    <li key={i} className="ml-4">{item}</li>
                  ))}
                </ul>

                <div className="flex flex-wrap gap-2 pt-1">
                  {exp.technologies.map((tech, i) => (
                    <span 
                      key={i}
                      className="px-3 py-1 text-sm bg-white/5 rounded-[8px] text-white/70 group-hover:bg-gradient-to-r group-hover:from-purple-400/20 group-hover:via-pink-400/20 group-hover:to-blue-400/20 transition-all duration-300"
                    >
                      {tech}
                    </span>
                  ))}
                </div>
              </div>
            </motion.div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Experience;
